import '../../styles/InsuranceCard.css';
import React,{Component} from 'react';
import {Grid, Card, CardHeader} from '@material-ui/core';
import {DriveEta, LocalHospital} from '@material-ui/icons';

class InsuranceCard extends Component{

    render(){
        return <Grid item xs = {4}>
            <Card>
                {this.getCardHeader()}
            </Card>
        </Grid>
    }

    getCardHeader = () => {
        return <CardHeader stats icon>
            {this.getCardIcon()}
        </CardHeader>
    }

    getCardIcon = () => {
        return <div className = 'card-icon'>
                {this.getIconFromType(this.props.insurance.type)}
            </div>;
    }

    getIconFromType = (type) => {
        switch(type){
            case 'vehicle': 
                return <DriveEta/>;
            case 'medical': 
            default: 
                return <LocalHospital/>;
        }
    }

}

export default InsuranceCard;
